using System;\nusing System.Collections.Generic;\n\nclass Program\n{\n    static void Main()\n    {\n        Dictionary<Guid, string> guidDictionary = new Dictionary<Guid, string>();\n        Dictionary<string, string> stringDictionary = new Dictionary<string, string>();\n\n        Guid testGuid = Guid.NewGuid();\n\n        // Adding elements to dictionaries\n        guidDictionary[testGuid] = "Value1";\n        stringDictionary[testGuid.ToString()] = "Value1";\n\n        // Accessing elements from dictionaries\n        Console.WriteLine(guidDictionary[testGuid]);\n        Console.WriteLine(stringDictionary[testGuid.ToString()]);\n    }\n}